import { View, StyleSheet } from 'react-native';
import { Animated } from './Animated';
import './customAnimations';

const globalDelay = 1000;

const circleAnimation = 'zoomIn',
  circleDelay = 500,
  circleDuration = 2000,
  circleEasing = 'ease-in-out',
  circleIterationCount = 1,
  circleSrc = require('./../../../assets/images/animation/circle_gray.png'),
  circleStyles = 'circle';

const handsLeftAnimation = 'slideInRight',
  handsLeftDelay = 2000,
  handsLeftDuration = 1200,
  handsLeftEasing = 'ease-in-out',
  handsLeftIterationCount = 1,
  handsLeftSrc = require('./../../../assets/images/animation/hand_blue.png'),
  handsLeftStyles = 'handsLeft';

const handsRightAnimation = 'slideInLeft',
  handsRightDelay = 1000,
  handsRightDuration = 1200,
  handsRightEasing = 'ease-in-out-quart',
  handsRightIterationCount = 1,
  handsRightSrc = require('./../../../assets/images/animation/hand_white.png'),
  handsRightStyles = 'handsRight';

const styles = StyleSheet.create({
  animationWrapper: {
    position: 'relative',
    overflow: 'hidden',
    height: Dimensions.CARD_IMAGE_SIZE_SMALL,
    width: Dimensions.CARD_IMAGE_SIZE_SMALL,
    //backgroundColor: 'red',
  },
  circle: {
    width: Dimensions.CARD_IMAGE_SIZE_SMALL * 0.8,
    height: Dimensions.CARD_IMAGE_SIZE_SMALL * 0.8,
  },
  handsLeft: {},
  handsRight: {},
  // tremor: {
  //   top: Dimensions.CARD_IMAGE_SIZE_SMALL,
  //   left: Dimensions.CARD_IMAGE_SIZE_SMALL * -0.1,
  // },
});

export const TremorHands = () => {
  return (
    <View style={styles.animationWrapper}>
      <Animated
        animation={circleAnimation}
        delay={globalDelay + circleDelay}
        duration={circleDuration}
        easing={circleEasing}
        iterationCount={circleIterationCount}
        source={circleSrc}
        styles={circleStyles}
      />
      <Animated
        animation={handsLeftAnimation}
        delay={globalDelay + handsLeftDelay}
        duration={handsLeftDuration}
        easing={handsLeftEasing}
        iterationCount={handsLeftIterationCount}
        source={handsLeftSrc}
        styles={handsLeftStyles}
      />
      <Animated
        animation={handsRightAnimation}
        delay={globalDelay + handsRightDelay}
        duration={handsRightDuration}
        easing={handsRightEasing}
        iterationCount={handsRightIterationCount}
        source={handsRightSrc}
        styles={handsRightStyles}
      />
    </View>
  );
};
